function initCallendar(){"use strict";$("#calendar").fullCalendar({allDaySlot:!1,defaultView:"agendaWeek",eventClick:eventClicked,eventColor:"#0275D8",events:getEvents,minTime:moment.duration("08:00:00"),maxTime:moment.duration("21:00:00"),weekends:!1,weekNumbers:!0});$("#calendar").fullCalendar("option","height","auto")}function getEvents(n,t,i,r){"use strict";$.get({url:"http://localhost:8000/api/classes/range/"+(n.format("YYYY-MM-DD")+"/"+t.format("YYYY-MM-DD")),success:function(n){r(n.map(classToEvent))}})}function eventClicked(n){"use strict";$.get({url:"http://localhost:8000/api/classes/id/"+n.id,success:function(n){$("#classTitle").text(n.subjectName);$("#classType").text(n.type);$("#classTime").text(moment.utc(n.dateTime).format("DD.MM.YYYY, dddd, HH:mm"));$("#classInfoModal").modal("show")}})}function classToEvent(n){"use strict";return{id:n.id,title:n.subjectName+": "+n.type,start:moment.utc(n.dateTime).format(),end:moment.utc(n.dateTime).add(1,"hours").add(20,"minutes").format()}}require(["../lib/moment/moment"],function(){document.readyState!=="complete"?$(document).ready(function(){initCallendar()}):initCallendar()});var moment=require("../lib/moment/moment");